import { Injectable } from "@angular/core";

@Injectable({
    providedIn: 'root'
}
)
export class AuthService {
    private token!: string;

    login(): void{
        this.token = 'MyFakeToken';
    }

    getToken(): string{
        return this.token;
    }
}
